import logo from './logo.svg';
import './App.css';
import BarraNavegacion from './BarraNavegacion';
import Contenedor from './Contenedor';

function App() {
  return (
    <div className="App">
      <BarraNavegacion/>
      <header className="App-header">
        <Contenedor/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         Me llamo pamela
        </p>


      </header>
    </div>
  );
}

export default App;
